import './App.scss';
import { DatePicker, Space } from 'antd';

const test = (date,dateString)=>{
  console.log(date, dateString);
}

function App() {
  return (
    <div className="App">
      <h1>Web personal cliente <span>Martin</span></h1>
      <h2>Color</h2>
      <Space direction="vertical">
        <DatePicker onChange={test} />
      </Space>    
    </div>
  );
}

export default App;
